	static constexpr size_t SizeofArray = ARRAYLENGTH(r_phi);
	static constexpr size_t NumEvents = SizeofArray / NumCoordinates;

	static auto Event(const size_t EventIndex) {
		try {
			if (EventIndex >= NumEvents) {
				throw std::out_of_range("SourceEvents_DetectorSensitivity::Event : Out of range");
			}
			return std::make_tuple<double, double>(double(r_phi[EventIndex * 2]), double(r_phi[EventIndex * 2 + 1]));
		}
		catch (std::out_of_range&) {
			throw;
		}
		
	}

